import { MenuIcon } from "@ya.praktikum/react-developer-burger-ui-components";
import { Logo } from "@ya.praktikum/react-developer-burger-ui-components";
import { ProfileIcon } from "@ya.praktikum/react-developer-burger-ui-components";
import { BurgerIcon } from "@ya.praktikum/react-developer-burger-ui-components";
import "@ya.praktikum/react-developer-burger-ui-components/dist/ui/box.css";

import appHeader from "./appHeader.module.css";

function handleBurgerClick() {
  console.log("test");
}

function AppHeader() {
  return (
    <header className={appHeader.box}>
      <BurgerIcon type="primary" />
      <p className="text text_type_main-default" onClick={handleBurgerClick}>
        Конструктор
      </p>

      <MenuIcon type="primary" />
      <span>Лента заказов</span>

      <Logo />

      <ProfileIcon type="primary" />
      <span>Личный кабинет</span>
    </header>
  );
}

export default AppHeader;
